import{_ as t,c as d,o as r,a3 as e}from"./chunks/framework.DpFyhY0e.js";const u=JSON.parse('{"title":"1.简介","description":"","frontmatter":{},"headers":[],"relativePath":"robot/ros/driverDetailDescription.md","filePath":"robot/ros/driverDetailDescription.md","lastUpdated":null}'),a={name:"robot/ros/driverDetailDescription.md"},o=e('<h1 id="_1-简介" tabindex="-1">1.简介 <a class="header-anchor" href="#_1-简介" aria-label="Permalink to &quot;1.简介&quot;">​</a></h1><p>为了方便用户通过ROS1控制机械臂，睿尔曼提供了基于JSON的ROS1功能包，有关机械臂的控制细节想要了解的话也可以参考JSON的相关文档和说明，在实际使用机械臂时，用户可通过以太网口与机械臂建立通信，并控制机械臂。</p><h1 id="_2-报错说明" tabindex="-1">2.报错说明 <a class="header-anchor" href="#_2-报错说明" aria-label="Permalink to &quot;2.报错说明&quot;">​</a></h1><h2 id="_2-1控制器错误代码" tabindex="-1">2.1控制器错误代码 <a class="header-anchor" href="#_2-1控制器错误代码" aria-label="Permalink to &quot;2.1控制器错误代码&quot;">​</a></h2><table tabindex="0"><thead><tr><th><strong>序号</strong></th><th><strong>错误代码（16进制）</strong></th><th><strong>错误内容</strong></th></tr></thead><tbody><tr><td>1</td><td>0x0000</td><td>系统正常</td></tr><tr><td>2</td><td>0x1001</td><td>关节通信异常</td></tr><tr><td>3</td><td>0x1002</td><td>目标角度超过限位</td></tr><tr><td>4</td><td>0x1003</td><td>该处不可达，为奇异点</td></tr><tr><td>5</td><td>0x1004</td><td>实时内核通信错误</td></tr><tr><td>6</td><td>0x1005</td><td>关节通信总线错误</td></tr><tr><td>7</td><td>0x1006</td><td>规划层内核错误</td></tr><tr><td>8</td><td>0x1007</td><td>关节超速</td></tr><tr><td>9</td><td>0x1008</td><td>末端接口板无法连接</td></tr><tr><td>10</td><td>0x1009</td><td>超速度限制</td></tr><tr><td>11</td><td>0x100A</td><td>超加速度限制</td></tr><tr><td>12</td><td>0x100B</td><td>关节抱闸未打开</td></tr><tr><td>13</td><td>0x100C</td><td>拖动示教时超速</td></tr><tr><td>14</td><td>0x100D</td><td>机械臂发生碰撞</td></tr><tr><td>15</td><td>0x100E</td><td>无该工作坐标系</td></tr><tr><td>16</td><td>0x100F</td><td>无该工具坐标系</td></tr><tr><td>17</td><td>0x1010</td><td>关节发生掉使能错误</td></tr><tr><td>18</td><td>0x1011</td><td>圆弧规划错误</td></tr><tr><td>19</td><td>0x1012</td><td>自碰撞错误</td></tr><tr><td>20</td><td>0x1013</td><td>碰撞到电子围栏错误（预留）</td></tr><tr><td>21</td><td>0x5001</td><td>预留</td></tr><tr><td>22</td><td>0x5002</td><td>预留</td></tr><tr><td>23</td><td>0x5003</td><td>控制器过温</td></tr><tr><td>24</td><td>0x5004</td><td>预留</td></tr><tr><td>25</td><td>0x5005</td><td>控制器过流</td></tr><tr><td>26</td><td>0x5006</td><td>控制器欠流</td></tr><tr><td>27</td><td>0x5007</td><td>控制器过压</td></tr><tr><td>28</td><td>0x5008</td><td>控制器欠压</td></tr><tr><td>29</td><td>0x5009</td><td>实时内核通讯错误</td></tr></tbody></table><h2 id="_2-2-关节错误代码" tabindex="-1">2.2 关节错误代码 <a class="header-anchor" href="#_2-2-关节错误代码" aria-label="Permalink to &quot;2.2 关节错误代码&quot;">​</a></h2><table tabindex="0"><thead><tr><th><strong>序号</strong></th><th><strong>错误代码（16进制）</strong></th><th><strong>错误内容</strong></th></tr></thead><tbody><tr><td>1</td><td>0x0000</td><td>关节正常</td></tr><tr><td>2</td><td>0x0001</td><td>FOC错误</td></tr><tr><td>3</td><td>0x0002</td><td>过压</td></tr><tr><td>4</td><td>0x0004</td><td>欠压</td></tr><tr><td>5</td><td>0x0008</td><td>过温</td></tr><tr><td>6</td><td>0x0010</td><td>启动失败</td></tr><tr><td>7</td><td>0x0020</td><td>编码器错误</td></tr><tr><td>8</td><td>0x0040</td><td>过流</td></tr><tr><td>9</td><td>0x0080</td><td>软件错误</td></tr><tr><td>10</td><td>0x0100</td><td>温度传感器错误</td></tr><tr><td>11</td><td>0x0200</td><td>位置超限错误</td></tr><tr><td>12</td><td>0x0400</td><td>关节ID非法</td></tr><tr><td>13</td><td>0x0800</td><td>位置跟踪错误</td></tr><tr><td>14</td><td>0x1000</td><td>电流检测错误</td></tr><tr><td>15</td><td>0x2000</td><td>抱闸打开失败</td></tr><tr><td>16</td><td>0x4000</td><td>位置指令阶跃警告</td></tr><tr><td>17</td><td>0x8000</td><td>多圈关节丢圈数</td></tr><tr><td>18</td><td>0xF000</td><td>通信丢帧</td></tr></tbody></table><h1 id="_3-ros功能包机械臂相关指令使用说明" tabindex="-1">3.ROS功能包机械臂相关指令使用说明 <a class="header-anchor" href="#_3-ros功能包机械臂相关指令使用说明" aria-label="Permalink to &quot;3.ROS功能包机械臂相关指令使用说明&quot;">​</a></h1><p>该部分介绍如何来通过ROS话题查询和控制机械臂。</p><h2 id="_3-1关节配置" tabindex="-1">3.1关节配置 <a class="header-anchor" href="#_3-1关节配置" aria-label="Permalink to &quot;3.1关节配置&quot;">​</a></h2><h3 id="_3-1-1设置关节使能状态" tabindex="-1">3.1.1设置关节使能状态 <a class="header-anchor" href="#_3-1-1设置关节使能状态" aria-label="Permalink to &quot;3.1.1设置关节使能状态&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>设置关节使能状态</th></tr></thead><tbody><tr><td>发布指令参数说明</td><td>Joint_Enable.msg #对指定关节进行使能操作 uint8 joint_num：#对应关节序号，从基座到机械臂手爪端，序号依次为1～6 bool state：#true-上使能，false-掉使能</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Joint_Enable rm_msgs/Joint_Enable &quot;joint_num: 1 state: true&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool   true-设置成功，false-设置失败</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/set_joint_err_clear_result</td></tr></tbody></table><h2 id="_3-2工具坐标系设置" tabindex="-1">3.2工具坐标系设置 <a class="header-anchor" href="#_3-2工具坐标系设置" aria-label="Permalink to &quot;3.2工具坐标系设置&quot;">​</a></h2><h3 id="_3-2-1切换当前工具坐标系" tabindex="-1">3.2.1切换当前工具坐标系 <a class="header-anchor" href="#_3-2-1切换当前工具坐标系" aria-label="Permalink to &quot;3.2.1切换当前工具坐标系&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>切换当前工作坐标系</th></tr></thead><tbody><tr><td>发布指令参数说明</td><td>ROS自带msg std_msgs::String</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/ChangeToolName_Cmd rm_msgs/ChangeTool_Name &quot;toolname: &#39;6WM&#39;&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool   true-设置成功，false-设置失败</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/ChangeTool_State</td></tr></tbody></table><h2 id="_3-3工作坐标系设置" tabindex="-1">3.3工作坐标系设置 <a class="header-anchor" href="#_3-3工作坐标系设置" aria-label="Permalink to &quot;3.3工作坐标系设置&quot;">​</a></h2><h3 id="_3-3-1切换当前工作坐标系" tabindex="-1">3.3.1切换当前工作坐标系 <a class="header-anchor" href="#_3-3-1切换当前工作坐标系" aria-label="Permalink to &quot;3.3.1切换当前工作坐标系&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>切换当前工作坐标系</th></tr></thead><tbody><tr><td>发布指令参数说明</td><td>ROS自带msg std_msgs::String</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/ChangeWorkFrame_Cmd rm_msgs/ChangeWorkFrame_Name &quot;WorkFrame_name: &#39;Base&#39;&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool   true-设置成功，false-设置失败</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/ChangeWorkFrame_State</td></tr></tbody></table><h2 id="_3-4坐标系查询" tabindex="-1">3.4坐标系查询 <a class="header-anchor" href="#_3-4坐标系查询" aria-label="Permalink to &quot;3.4坐标系查询&quot;">​</a></h2><h3 id="_3-4-1查询当前工作坐标系" tabindex="-1">3.4.1查询当前工作坐标系 <a class="header-anchor" href="#_3-4-1查询当前工作坐标系" aria-label="Permalink to &quot;3.4.1查询当前工作坐标系&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>查询当前工具坐标系</th></tr></thead><tbody><tr><td>参数说明</td><td>ROS自带msg std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/GetTotalWorkFrame std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>无</td></tr><tr><td>返回值查看</td><td>根据rm_driver节点打印信息查看</td></tr></tbody></table><h2 id="_3-5机械臂状态查询" tabindex="-1">3.5机械臂状态查询 <a class="header-anchor" href="#_3-5机械臂状态查询" aria-label="Permalink to &quot;3.5机械臂状态查询&quot;">​</a></h2><h3 id="_3-5-1获取机械臂关节当前电流" tabindex="-1">3.5.1获取机械臂关节当前电流 <a class="header-anchor" href="#_3-5-1获取机械臂关节当前电流" aria-label="Permalink to &quot;3.5.1获取机械臂关节当前电流&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>获取机械臂当前电流</th></tr></thead><tbody><tr><td>参数说明</td><td>ROS自带msg std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/GetCurrentJointCurrent std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>Joint_Current.msg  float32[] joint_current     #关节电流（单位：uA）</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Joint_Current</td></tr></tbody></table><h2 id="_3-6机械臂运动规划" tabindex="-1">3.6机械臂运动规划 <a class="header-anchor" href="#_3-6机械臂运动规划" aria-label="Permalink to &quot;3.6机械臂运动规划&quot;">​</a></h2><h3 id="_3-6-1关节空间运动" tabindex="-1">3.6.1关节空间运动 <a class="header-anchor" href="#_3-6-1关节空间运动" aria-label="Permalink to &quot;3.6.1关节空间运动&quot;">​</a></h3><table><thead><tr><th>功能描述</th><th>关节空间运动MOVEJ</th></tr></thead><tbody><tr><td>参数说明</td><td>MoveJ.msg float32[] joint：关节角度，单位：弧度。 float32 speed：速度比例系数，0~1。 uint8 trajectory_connect：可选参数，代表是否和下一条运动一起规划，0代表立即规划，1代表和下一条轨迹一起规划，当为1时，轨迹不会立即执行。</td></tr><tr><td>命令示例</td><td>六自由度 rostopic pub /rm_driver/MoveJ_Cmd rm_msgs/MoveJ &quot;joint: [0, 0, 0, 0, 0, 0] speed: 0.2&quot; 七自由度 rostopic pub /rm_driver/MoveJ_Cmd rm_msgs/MoveJ &quot;joint: [0, 0, 0, 0, 0, 0, 0] speed: 0.2 trajectory_connect: 0&quot;</td></tr><tr><td rowspan="2">返值</td><td>std_msgs::Bool 成功返回：true；失败返回：false。</td></tr><tr><td>rostopic echo /rm_driver/Plan_State</td></tr></tbody></table><h3 id="_3-6-2笛卡尔空间直线运动" tabindex="-1">3.6.2笛卡尔空间直线运动 <a class="header-anchor" href="#_3-6-2笛卡尔空间直线运动" aria-label="Permalink to &quot;3.6.2笛卡尔空间直线运动&quot;">​</a></h3><table><thead><tr><th>功能描述</th><th>笛卡尔空间直线运动MOVEL</th></tr></thead><tbody><tr><td>参数说明</td><td>MoveL.msg geometry_msgs/Pose Pose：机械臂位姿，geometry_msgs/Pose类型，x、y、z坐标（float类型，单位：m）+四元数。 float32 speed：速度比例系数，0~1。 uint8 trajectory_connect：可选参数，代表是否和下一条运动一起规划，0代表立即规划，1代表和下一条轨迹一起规划，当为1时，轨迹不会立即执行。</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/MoveL_Cmd rm_msgs/MoveL &quot;Pose: position: x: 0.0 y: 0.0 z: 0.0 orientation: x: 0.0 y: 0.0 z: 0.0 w: 0.0 speed: 0.2 trajectory_connect: 0&quot;</td></tr><tr><td rowspan="2">返值</td><td>std_msgs::Bool 成功返回：true；失败返回：false。</td></tr><tr><td>rostopic echo /rm_driver/Plan_State</td></tr></tbody></table><h3 id="_3-6-3笛卡尔空间圆弧运动" tabindex="-1">3.6.3笛卡尔空间圆弧运动 <a class="header-anchor" href="#_3-6-3笛卡尔空间圆弧运动" aria-label="Permalink to &quot;3.6.3笛卡尔空间圆弧运动&quot;">​</a></h3><table><thead><tr><th>功能描述</th><th>笛卡尔空间圆弧运动MOVEC</th></tr></thead><tbody><tr><td>参数说明</td><td>MoveC.msg geometry_msgs/Pose Mid_Pose：中间位姿，geometry_msgs/Pose类型，x、y、z坐标（float类型，单位：m）+四元数。 geometry_msgs/Pose End_Pose：终点位姿，geometry_msgs/Pose类型，x、y、z坐标（float类型，单位：m）+四元数。 float32 speed：速度比例系数，0~1。 uint16 loop：旋转圈数。 uint8 trajectory_connect：可选参数，代表是否和下一条运动一起规划，0代表立即规划，1代表和下一条轨迹一起规划，当为1时，轨迹不会立即执行。</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/MoveC_Cmd rm_msgs/MoveC &quot;Mid_Pose: position: x: 0.2949 y: 0.1377 z: 0.1048 orientation: x: 0.05 y: -0.989 z: -0.1359 w: 0.0274 End_Pose: position: x: 0.2417 y: 0.0 z: 0.1213 orientation: x: 0.0136 y: 0.9993 z: 0.0241 w: 0.0261 speed: 0.5 trajectory_connect: 0&quot;</td></tr><tr><td rowspan="2">返值</td><td>std_msgs::Bool 成功返回：true；失败返回：false。</td></tr><tr><td>rostopic echo /rm_driver/Plan_State</td></tr></tbody></table><h3 id="_3-6-4关节角度canfd透传" tabindex="-1">3.6.4关节角度CANFD透传 <a class="header-anchor" href="#_3-6-4关节角度canfd透传" aria-label="Permalink to &quot;3.6.4关节角度CANFD透传&quot;">​</a></h3><table><thead><tr><th>功能描述</th><th>关节角度CANFD透传</th></tr></thead><tbody><tr><td>参数说明</td><td>JointPos.msg float32[] joint：关节角度，单位：弧度。 float32 expand：拓展关节，单位：弧度。</td></tr><tr><td>命令示例</td><td>透传需要连续发送多个连续的点实现，单纯靠以下命令并不能实现功能，当前moveit控制使用了角度透传的控制方式。 rostopic pub /rm_driver/JointPos rm_msgs/JointPos &quot;joint: [0, 0, 0, 0, 0, 0] expand: 0.0&quot;</td></tr><tr><td rowspan="2">返值</td><td>成功：无返回值；失败返回：driver终端返回错误码。</td></tr><tr><td></td></tr></tbody></table><h3 id="_3-6-5位姿canfd透传" tabindex="-1">3.6.5位姿CANFD透传 <a class="header-anchor" href="#_3-6-5位姿canfd透传" aria-label="Permalink to &quot;3.6.5位姿CANFD透传&quot;">​</a></h3><table><thead><tr><th>功能描述</th><th>位姿CANFD透传</th></tr></thead><tbody><tr><td>参数说明</td><td>CartePos.msg geometry_msgs/Pose Pose：透传位姿，geometry_msgs/Pose类型，x、y、z坐标（float类型，单位：m）+四元数。</td></tr><tr><td>命令示例</td><td>需要是大量（10个以上）位置连续的点，单纯靠以下命令并不能实现功能，以2ms以上的周期持续发布。 rostopic pub /rm_driver/MoveP_Fd_Cmd rm_msgs/CartePos &quot;Pose: position: x: 0.0 y: 0.0 z: 0.0 orientation: x: 0.0 y: 0.0 z: 0.0 w: 0.0&quot;</td></tr><tr><td rowspan="2">返值</td><td>成功：无返回值；失败返回：driver终端返回错误码。</td></tr><tr><td></td></tr></tbody></table><h3 id="_3-6-6关节空间规划到目标位姿" tabindex="-1">3.6.6关节空间规划到目标位姿 <a class="header-anchor" href="#_3-6-6关节空间规划到目标位姿" aria-label="Permalink to &quot;3.6.6关节空间规划到目标位姿&quot;">​</a></h3><table><thead><tr><th>功能描述</th><th>关节空间规划到目标位姿MOVEJP</th></tr></thead><tbody><tr><td>参数说明</td><td>MoveJ_P.msg geometry_msgs/Pose Pose：目标位姿，x、y、z坐标（float类型，单位：m）+四元数。 float32 speed：速度百分比例系数，0~1。 uint8 trajectory_connect：可选参数，代表是否和下一条运动一起规划，0代表立即规划，1代表和下一条轨迹一起规划，当为1时，轨迹不会立即执行。</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/MoveJ_P_Cmd rm_msgs/MoveJ_P &quot;Pose: position: x: 0.0 y: 0.0 z: 0.0 orientation: x: 0.0 y: 0.0 z: 0.0 w: 0.0 speed: 0.0 trajectory_connect: 0&quot;</td></tr><tr><td rowspan="2">返值</td><td>std_msgs::Bool 成功返回：true；失败返回：false。</td></tr><tr><td>rostopic echo /rm_driver/Plan_State</td></tr></tbody></table><h2 id="_3-7机械臂运动配置-步进指令" tabindex="-1">3.7机械臂运动配置-步进指令 <a class="header-anchor" href="#_3-7机械臂运动配置-步进指令" aria-label="Permalink to &quot;3.7机械臂运动配置-步进指令&quot;">​</a></h2><h3 id="_3-7-1关节步进" tabindex="-1">3.7.1关节步进 <a class="header-anchor" href="#_3-7-1关节步进" aria-label="Permalink to &quot;3.7.1关节步进&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>关节步进</th></tr></thead><tbody><tr><td>参数说明</td><td>Joint_Step.msg uint8 joint_num      #要运动的关节 float32 step_angle    #步进角度（单位：角度） float32 speed        #运动速度</td></tr><tr><td>命令示例</td><td>六自由度 rostopic pub /rm_driver/SetJointStep rm_msgs/Joint_Step &quot;joint_num: 6 step_angle: 90.0  speed: 0.2&quot;七自由度 rostopic pub /rm_driver/MoveJ_Cmd rm_msgs/MoveJ &quot;joint:  [0, 0, 0, 0, 0, 0, 0] speed: 0.2&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool   成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Plan_State</td></tr></tbody></table><h2 id="_3-8机械臂运动配置-运动指令" tabindex="-1">3.8机械臂运动配置-运动指令 <a class="header-anchor" href="#_3-8机械臂运动配置-运动指令" aria-label="Permalink to &quot;3.8机械臂运动配置-运动指令&quot;">​</a></h2><h3 id="_3-8-1轨迹急停" tabindex="-1">3.8.1轨迹急停 <a class="header-anchor" href="#_3-8-1轨迹急停" aria-label="Permalink to &quot;3.8.1轨迹急停&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>轨迹急停</th></tr></thead><tbody><tr><td>参数说明</td><td>Stop.msg bool state      #true生效 false 不生效</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Emergency_Stop rm_msgs/Stop &quot;state: true&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool   成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Arm_Stop_Result</td></tr></tbody></table><h2 id="_3-9机械臂运动配置-示教指令类" tabindex="-1">3.9机械臂运动配置-示教指令类 <a class="header-anchor" href="#_3-9机械臂运动配置-示教指令类" aria-label="Permalink to &quot;3.9机械臂运动配置-示教指令类&quot;">​</a></h2><h3 id="_3-9-1关节示教" tabindex="-1">3.9.1关节示教 <a class="header-anchor" href="#_3-9-1关节示教" aria-label="Permalink to &quot;3.9.1关节示教&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>关节示教</th></tr></thead><tbody><tr><td>参数说明</td><td>Joint_Teach.msg int16 teach_joint   示教控制关节 string direction     关节转动方向 “pos”：正方向，“neg”：反方向 int16 v            关节转动速度0-100</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Arm_JointTeach std_msgs/msg/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/SetJointTeach_Result</td></tr></tbody></table><h3 id="_3-9-2位置示教" tabindex="-1">3.9.2位置示教 <a class="header-anchor" href="#_3-9-2位置示教" aria-label="Permalink to &quot;3.9.2位置示教&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>位置示教</th></tr></thead><tbody><tr><td>参数说明</td><td>Pos_Teach.msg string teach_type   坐标轴，”x”,”y”,”z” string direction     示教方向 “pos”：正方向，“neg”：反方向 int16 v            关节转动速度0-100</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Arm_PosTeach rm_msgs/Pos_Teach &quot;teach_type: &#39;z&#39; direction: &#39;pos&#39; v: 10&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/SetPosTeach_Result</td></tr></tbody></table><h3 id="_3-9-3姿态示教" tabindex="-1">3.9.3姿态示教 <a class="header-anchor" href="#_3-9-3姿态示教" aria-label="Permalink to &quot;3.9.3姿态示教&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>姿态示教</th></tr></thead><tbody><tr><td>参数说明</td><td>Ort_Teach.msg string teach_type   旋转所绕坐标轴，”rx”,“ry”,“rz” string direction     示教方向 “pos”：正方向，“neg”：反方向 int16 v            关节转动速度0-100</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Arm_OrtTeach rm_msgs/Ort_Teach &quot;teach_type: &#39;rz&#39; direction: &#39;pos&#39; v: 10&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/SetOrtTeach_Result</td></tr></tbody></table><h3 id="_3-9-4示教停止" tabindex="-1">3.9.4示教停止 <a class="header-anchor" href="#_3-9-4示教停止" aria-label="Permalink to &quot;3.9.4示教停止&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>示教停止</th></tr></thead><tbody><tr><td>参数说明</td><td>Stop_Teach.msg string command     停止指令“set_stop_teach”，运行以下指令即可</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Arm_StopTeach rm_msgs/Stop_Teach &quot;command: &#39;&#39;&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/SetStopTeach_Result</td></tr></tbody></table><h2 id="_3-10系统配置" tabindex="-1">3.10系统配置 <a class="header-anchor" href="#_3-10系统配置" aria-label="Permalink to &quot;3.10系统配置&quot;">​</a></h2><h3 id="_3-10-1控制机械臂上电断电" tabindex="-1">3.10.1控制机械臂上电断电 <a class="header-anchor" href="#_3-10-1控制机械臂上电断电" aria-label="Permalink to &quot;3.10.1控制机械臂上电断电&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>控制机械臂上电断电</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Byte msg    1控制机械臂上电 0控制机械臂断电</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/SetArmPower std_msgs/Byte &quot;data: 0&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Arm_Power_Result</td></tr></tbody></table><h3 id="_3-10-2读取软件版本号" tabindex="-1">3.10.2读取软件版本号 <a class="header-anchor" href="#_3-10-2读取软件版本号" aria-label="Permalink to &quot;3.10.2读取软件版本号&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>读取软件版本号</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Byte msg    1控制机械臂上电 0控制机械臂断电</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Get_Arm_Software_Version std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>Arm type is RML63-BI Arm version is 3b0146</td></tr><tr><td>返回值查看</td><td>rm_driver节点终端</td></tr></tbody></table><h3 id="_3-10-3清除系统错误" tabindex="-1">3.10.3清除系统错误 <a class="header-anchor" href="#_3-10-3清除系统错误" aria-label="Permalink to &quot;3.10.3清除系统错误&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>清除系统错误</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty msg</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Clear_System_Err std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/System_En_State_Result</td></tr></tbody></table><h2 id="_3-11查询机械臂状态信息" tabindex="-1">3.11查询机械臂状态信息 <a class="header-anchor" href="#_3-11查询机械臂状态信息" aria-label="Permalink to &quot;3.11查询机械臂状态信息&quot;">​</a></h2><h3 id="_3-11-1获取机械臂关节当前电流" tabindex="-1">3.11.1获取机械臂关节当前电流 <a class="header-anchor" href="#_3-11-1获取机械臂关节当前电流" aria-label="Permalink to &quot;3.11.1获取机械臂关节当前电流&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>获取机械臂当前电流</th></tr></thead><tbody><tr><td>参数说明</td><td>ROS自带msg std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/GetCurrentJointCurrent std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>Joint_Current.msg  float32[] joint_current     #关节电流（单位：uA）</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Joint_Current</td></tr></tbody></table><h3 id="_3-11-2查询机械臂关节角度" tabindex="-1">3.11.2查询机械臂关节角度 <a class="header-anchor" href="#_3-11-2查询机械臂关节角度" aria-label="Permalink to &quot;3.11.2查询机械臂关节角度&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>查询机械臂关节角度</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty msg</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/GetArmJoint_Cmd std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>sensor_msgs::JointState</td></tr><tr><td>返回值查看</td><td>rostopic echo /joint_states</td></tr></tbody></table><h3 id="_3-11-3查询机械臂状态-弧度-四元数" tabindex="-1">3.11.3查询机械臂状态（弧度+四元数） <a class="header-anchor" href="#_3-11-3查询机械臂状态-弧度-四元数" aria-label="Permalink to &quot;3.11.3查询机械臂状态（弧度+四元数）&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>查询机械臂状态</th></tr></thead><tbody><tr><td>参数说明</td><td>GetArmState_Command.msg string command</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/GetArmState_Cmd rm_msgs/GetArmState_Command &quot;command: &#39;&#39;&quot;</td></tr><tr><td>返回值参数说明</td><td>ArmState.msg float32[] joint            #机械臂弧度信息 geometry_msgs/Pose Pose    #机械臂当前位姿（四元数） uint16 arm_err             #机械臂错误信息 uint16 sys_err             #系统错误信息 uint8  dof                 #机械臂自由度</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/ArmCurrentState</td></tr></tbody></table><h3 id="_3-11-4查询机械臂状态-角度-欧拉角" tabindex="-1">3.11.4查询机械臂状态（角度+欧拉角） <a class="header-anchor" href="#_3-11-4查询机械臂状态-角度-欧拉角" aria-label="Permalink to &quot;3.11.4查询机械臂状态（角度+欧拉角）&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>查询机械臂状态</th></tr></thead><tbody><tr><td>参数说明</td><td>GetArmState_Command.msg string command</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/GetArmState_Cmd rm_msgs/GetArmState_Command &quot;command: &#39;&#39;&quot;</td></tr><tr><td>返回值参数说明</td><td>Arm_Current_State.msg float32[] joint            #机械臂角度信息 float32[6] Pose        #机械臂当前位姿（欧拉角） uint16 arm_err         #机械臂错误信息 uint16 sys_err          #系统错误信息 uint8  dof                 #机械臂自由度</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Arm_Current_State</td></tr></tbody></table><h2 id="_3-12控制器io配置及获取" tabindex="-1">3.12控制器IO配置及获取 <a class="header-anchor" href="#_3-12控制器io配置及获取" aria-label="Permalink to &quot;3.12控制器IO配置及获取&quot;">​</a></h2><h3 id="_3-12-1设置机械臂数字io输出状态" tabindex="-1">3.12.1设置机械臂数字IO输出状态 <a class="header-anchor" href="#_3-12-1设置机械臂数字io输出状态" aria-label="Permalink to &quot;3.12.1设置机械臂数字IO输出状态&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>查询机械臂关节角度</th></tr></thead><tbody><tr><td>参数说明</td><td>Arm_Digital_Output.msg uint8 num       # IO端口号，范围：1~4 bool state       # “state”：IO状态，1-输出高，0-输出低</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Arm_Digital_Output rm_msgs/Arm_Digital_Output &quot;num: 1 state: true&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_DO_State_Result</td></tr></tbody></table><h3 id="_3-12-2获取所有io输入状态" tabindex="-1">3.12.2获取所有IO输入状态 <a class="header-anchor" href="#_3-12-2获取所有io输入状态" aria-label="Permalink to &quot;3.12.2获取所有IO输入状态&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>查询机械臂关节角度</th></tr></thead><tbody><tr><td>参数说明</td><td>IO_Update.msg uint8 type   1查询控制器IO状态; 2查询工具端IO状态</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/IO_Update rm_msgs/IO_Update &quot;type: 1&quot;</td></tr><tr><td>返回值参数说明</td><td>Arm_IO_State.msg int8[4] Arm_Digital_Input  #0代表低；1代表高；-1代表为输出状态</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Arm_IO_State</td></tr></tbody></table><h2 id="_3-13工具端io配置及获取" tabindex="-1">3.13工具端IO配置及获取 <a class="header-anchor" href="#_3-13工具端io配置及获取" aria-label="Permalink to &quot;3.13工具端IO配置及获取&quot;">​</a></h2><h3 id="_3-13-1设置工具端数字io输出状态" tabindex="-1">3.13.1设置工具端数字IO输出状态 <a class="header-anchor" href="#_3-13-1设置工具端数字io输出状态" aria-label="Permalink to &quot;3.13.1设置工具端数字IO输出状态&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>查询机械臂关节角度</th></tr></thead><tbody><tr><td>参数说明</td><td>Tool_Digital_Output.msg uint8 num        # IO端口号，范围：1~4 bool state        # “state”：IO状态，1-输出高，0-输出低</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Tool_Digital_Output rm_msgs/Tool_Digital_Output &quot;num: 1 state: true&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Tool_DO_State_Result</td></tr></tbody></table><h3 id="_3-13-2获取工具端数字io状态" tabindex="-1">3.13.2获取工具端数字IO状态 <a class="header-anchor" href="#_3-13-2获取工具端数字io状态" aria-label="Permalink to &quot;3.13.2获取工具端数字IO状态&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>查询机械臂关节角度</th></tr></thead><tbody><tr><td>参数说明</td><td>IO_Update.msg uint8 type    1查询控制器IO状态; 2查询工具端IO状态</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/IO_Update rm_msgs/IO_Update &quot;type: 2&quot;</td></tr><tr><td>返回值参数说明</td><td>Tool_IO_State.msg bool[2] Tool_IO_Mode  #数字I/O输入/输出状态  0-输入模式，1-输出模式 bool[2] Tool_IO_State   #数字I/O电平状态      0-低，1-高</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Tool_IO_State</td></tr></tbody></table><h2 id="_3-14末端手爪控制-选配" tabindex="-1">3.14末端手爪控制（选配） <a class="header-anchor" href="#_3-14末端手爪控制-选配" aria-label="Permalink to &quot;3.14末端手爪控制（选配）&quot;">​</a></h2><p>睿尔曼机械臂末端配备了因时机器人公司的EG2-4C2手爪，为了便于用户操作手爪，机械臂控制器对用户适配了手爪的ROS控制方式</p><h3 id="_3-14-1设置夹爪持续力控夹取" tabindex="-1">3.14.1设置夹爪持续力控夹取 <a class="header-anchor" href="#_3-14-1设置夹爪持续力控夹取" aria-label="Permalink to &quot;3.14.1设置夹爪持续力控夹取&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>设置夹爪力控夹取</th></tr></thead><tbody><tr><td>参数说明</td><td>Gripper_Pick.msg #手爪以设定的速度力控夹取，当受力超过设定力后，停止运动 uint16 speed         #1~1000,代表手爪开合速度，无量纲 uint16 force         #1～1000,代表手爪夹持力，最大1.5kg</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Gripper_Pick_On rm_msgs/Gripper_Pick &quot;speed: 100 force: 100&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Gripper_Result</td></tr></tbody></table><h3 id="_3-14-2设置夹爪力控夹取" tabindex="-1">3.14.2设置夹爪力控夹取 <a class="header-anchor" href="#_3-14-2设置夹爪力控夹取" aria-label="Permalink to &quot;3.14.2设置夹爪力控夹取&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>设置夹爪持续力控夹取</th></tr></thead><tbody><tr><td>参数说明</td><td>Gripper_Pick.msg #手爪以设定的速度力控夹取，当受力超过设定力后，停止运动 uint16 speed         #1~1000,代表手爪开合速度，无量纲 uint16 force         #1～1000,代表手爪夹持力，最大1.5kg</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Gripper_Pick rm_msgs/Gripper_Pick &quot;speed: 100 force: 100&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Gripper_Result</td></tr></tbody></table><h3 id="_3-14-3夹爪到达指定位置" tabindex="-1">3.14.3夹爪到达指定位置 <a class="header-anchor" href="#_3-14-3夹爪到达指定位置" aria-label="Permalink to &quot;3.14.3夹爪到达指定位置&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>夹爪到达指定位置</th></tr></thead><tbody><tr><td>参数说明</td><td>Gripper_Set.msg  #设置手爪到固定位置，手爪到位置后或者所受力超过阈值后停止 uint16 position   #手爪目标位置，范围：1～1000,代表手爪开口度：0～70mm</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Gripper_Set rm_msgs/Gripper_Set &quot;position: 100&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Gripper_Result</td></tr></tbody></table><h2 id="_3-15末端六维力传感器的使用-选配" tabindex="-1">3.15末端六维力传感器的使用（选配） <a class="header-anchor" href="#_3-15末端六维力传感器的使用-选配" aria-label="Permalink to &quot;3.15末端六维力传感器的使用（选配）&quot;">​</a></h2><p>睿尔曼RM-65F机械臂末端配备集成式六维力传感器，无需外部走线，用户可直接通过ROS话题对六维力进行操作。</p><h3 id="_3-15-1查询六维力数据" tabindex="-1">3.15.1查询六维力数据 <a class="header-anchor" href="#_3-15-1查询六维力数据" aria-label="Permalink to &quot;3.15.1查询六维力数据&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>查询六维力数据</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/GetSixForce_Cmd std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>Six_Force.msg float32 force_Fx float32 force_Fy float32 force_Fz float32 force_Mx float32 force_My float32 force_Mz</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/GetSixForce     #六维力原始数据 rostopic echo /rm_driver/SixZeroForce   #传感器坐标系下的六维力数据 rostopic echo /rm_driver/WorkZeroForce #工作坐标系下的传感器数据 rostopic echo /rm_driver/ToolZeroForce #工具坐标系下的传感器数据</td></tr></tbody></table><h3 id="_3-15-2清空六维力数据" tabindex="-1">3.15.2清空六维力数据 <a class="header-anchor" href="#_3-15-2清空六维力数据" aria-label="Permalink to &quot;3.15.2清空六维力数据&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>清空六维力数据</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/ClearForceData_Cmd std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/ClearForceData_result</td></tr></tbody></table><h3 id="_3-15-3自动设置六维力重心参数" tabindex="-1">3.15.3自动设置六维力重心参数 <a class="header-anchor" href="#_3-15-3自动设置六维力重心参数" aria-label="Permalink to &quot;3.15.3自动设置六维力重心参数&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>自动设置六维力重心参数</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/SetForceSensor_Cmd std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/ForceSensorSet_result</td></tr></tbody></table><h3 id="_3-15-4手动标定六维力数据" tabindex="-1">3.15.4手动标定六维力数据 <a class="header-anchor" href="#_3-15-4手动标定六维力数据" aria-label="Permalink to &quot;3.15.4手动标定六维力数据&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>手动标定六维力数据</th></tr></thead><tbody><tr><td>参数说明</td><td>Manual_Set_Force_Pose.msg string pose pose1:位置1关节角度;  pose2:位置2关节角度; pose3:位置3关节角度;  pose4:位置4关节角度; int64[] joint   0.001角度，如90度为90000</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/ManualSetForcePose_Cmd rm_msgs/Manual_Set_Force_Pose &quot;pose: &#39; pose1&#39; joint:  [0, 0, 0, 0, 90000, 0]&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>/rm_driver/ForceSensorSet_result</td></tr></tbody></table><h3 id="_3-15-5停止标定力传感器重心" tabindex="-1">3.15.5停止标定力传感器重心 <a class="header-anchor" href="#_3-15-5停止标定力传感器重心" aria-label="Permalink to &quot;3.15.5停止标定力传感器重心&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>停止标定力传感器重心</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/StopSetForceSensor_Cmd std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/StopSetForceSensor_result</td></tr></tbody></table><h2 id="_3-16拖动示教" tabindex="-1">3.16拖动示教 <a class="header-anchor" href="#_3-16拖动示教" aria-label="Permalink to &quot;3.16拖动示教&quot;">​</a></h2><h3 id="_3-16-1拖动示教结束" tabindex="-1">3.16.1拖动示教结束 <a class="header-anchor" href="#_3-16-1拖动示教结束" aria-label="Permalink to &quot;3.16.1拖动示教结束&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>拖动示教结束</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/StartMultiDragTeach_result std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/StopDragTeach_result</td></tr></tbody></table><h3 id="_3-16-2开启复合拖动示教" tabindex="-1">3.16.2开启复合拖动示教 <a class="header-anchor" href="#_3-16-2开启复合拖动示教" aria-label="Permalink to &quot;3.16.2开启复合拖动示教&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>拖动示教结束</th></tr></thead><tbody><tr><td>参数说明</td><td>Start_Multi_Drag_Teach.msg uint8 mode 0-电流环模式，1-使用末端六维力，只动位置，2-使用末端六维力，只动姿态，3-使用末端六维力，位置和姿态同时动</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/StartMultiDragTeach_Cmd rm_msgs/Start_Multi_Drag_Teach &quot;mode: 0&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/StartMultiDragTeach_result</td></tr></tbody></table><h3 id="_3-16-3力位混合控制" tabindex="-1">3.16.3力位混合控制 <a class="header-anchor" href="#_3-16-3力位混合控制" aria-label="Permalink to &quot;3.16.3力位混合控制&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>结束力位混合控制</th></tr></thead><tbody><tr><td>参数说明</td><td>Set_Force_Position.msg uint8 sensor    #传感器；0-一维力；1-六维力 uint8 mode     #0-工作坐标系力控；1-工具坐标系 uint8 direction   #力控方向；0-沿X轴；1-沿Y轴；2-沿Z轴；3-沿RX姿态方向；4-沿RY姿态方向；5-沿RZ姿态方向 int16 N         # N:力的大小，单位0.1N</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/SetForcePosition_Cmd rm_msgs/Set_Force_Position &quot;sensor: 0 mode: 0 direction: 0 N: 0&quot;。</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/SetForcePosition_result</td></tr></tbody></table><h3 id="_3-16-4结束力位混合控制" tabindex="-1">3.16.4结束力位混合控制 <a class="header-anchor" href="#_3-16-4结束力位混合控制" aria-label="Permalink to &quot;3.16.4结束力位混合控制&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>结束力位混合控制</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/StopForcePostion_Cmd std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/StopForcePostion_result</td></tr></tbody></table><h2 id="_3-17末端五指灵巧手控制-选配" tabindex="-1">3.17末端五指灵巧手控制（选配） <a class="header-anchor" href="#_3-17末端五指灵巧手控制-选配" aria-label="Permalink to &quot;3.17末端五指灵巧手控制（选配）&quot;">​</a></h2><p>睿尔曼机械臂末端配备了五指灵巧手，可通过ROS对灵巧手进行设置。</p><h3 id="_3-17-1设置灵巧手手势序号" tabindex="-1">3.17.1设置灵巧手手势序号 <a class="header-anchor" href="#_3-17-1设置灵巧手手势序号" aria-label="Permalink to &quot;3.17.1设置灵巧手手势序号&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>结束力位混合控制</th></tr></thead><tbody><tr><td>参数说明</td><td>Hand_Posture.msg #设置灵巧手手势 uint16 posture_num    #预先保存在灵巧手内的手势序号，范围：1~40</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Hand_SetPosture rm_msgs/Hand_Posture &quot;posture_num: 0&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Hand_Posture_Result</td></tr></tbody></table><h3 id="_3-17-2设置灵巧手动作序列" tabindex="-1">3.17.2设置灵巧手动作序列 <a class="header-anchor" href="#_3-17-2设置灵巧手动作序列" aria-label="Permalink to &quot;3.17.2设置灵巧手动作序列&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>设置灵巧手动作序列</th></tr></thead><tbody><tr><td>参数说明</td><td>Hand_Seq.msg #设置灵巧手动作序列 uint16 seq_num   #预先保存在灵巧手内的序列序号，范围：1~40</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Hand_SetSeq rm_msgs/Hand_Seq &quot;seq_num: 0&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Hand_Seq_Result</td></tr></tbody></table><h3 id="_3-17-3设置灵巧手各自由度角度" tabindex="-1">3.17.3设置灵巧手各自由度角度 <a class="header-anchor" href="#_3-17-3设置灵巧手各自由度角度" aria-label="Permalink to &quot;3.17.3设置灵巧手各自由度角度&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>设置灵巧手各自由度角度</th></tr></thead><tbody><tr><td>参数说明</td><td>Hand_Angle.msg #设置灵巧手角度，灵巧手有 6 个自由度，从 1~6 分别为小拇指，无名指，中指，食指，大拇指弯曲，大拇指旋转 int16[6] hand_angle  #手指角度数组，范围：0~1000.另外，-1 代表该自由度不执行任何操作，保持当前状态</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Hand_SetAngle rm_msgs/Hand_Angle &quot;hand_angle: [0, 0, 0, 0, 0, 0]&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Hand_Angle_Result</td></tr></tbody></table><h3 id="_3-17-4设置灵巧手速度" tabindex="-1">3.17.4设置灵巧手速度 <a class="header-anchor" href="#_3-17-4设置灵巧手速度" aria-label="Permalink to &quot;3.17.4设置灵巧手速度&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>设置灵巧手速度</th></tr></thead><tbody><tr><td>参数说明</td><td>Hand_Speed.msg #设置灵巧手关节速度 uint16 hand_speed   #手指速度，范围：1~1000</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Hand_SetSpeed rm_msgs/Hand_Speed &quot;hand_speed: 0&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Hand_Speed_Result</td></tr></tbody></table><h3 id="_3-17-5设置灵巧手力阈值" tabindex="-1">3.17.5设置灵巧手力阈值 <a class="header-anchor" href="#_3-17-5设置灵巧手力阈值" aria-label="Permalink to &quot;3.17.5设置灵巧手力阈值&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>设置灵巧手力阈值</th></tr></thead><tbody><tr><td>参数说明</td><td>Hand_Force.msg #设置灵巧手关节力阈值 uint16 hand_force#手指力，范围：1~1000</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Hand_SetForce rm_msgs/Hand_Force &quot;hand_force: 0&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Hand_Force_Result</td></tr></tbody></table><h2 id="_3-18透传力位混合控制补偿模式" tabindex="-1">3.18透传力位混合控制补偿模式 <a class="header-anchor" href="#_3-18透传力位混合控制补偿模式" aria-label="Permalink to &quot;3.18透传力位混合控制补偿模式&quot;">​</a></h2><p>针对睿尔曼带一维力和六维力版本的机械臂，用户除了可直接使用示教器调用底层的力位混合控制模块外，还可以将自定义的轨迹以周期性透传的形式结合底层的力位混合控制算法进行补偿。</p><h3 id="_3-18-1开启透传力位混合控制补偿模式" tabindex="-1">3.18.1开启透传力位混合控制补偿模式 <a class="header-anchor" href="#_3-18-1开启透传力位混合控制补偿模式" aria-label="Permalink to &quot;3.18.1开启透传力位混合控制补偿模式&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>开启透传力位混合控制补偿模式</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/StartForcePositionMove_Cmd std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/StartForcePositionMove_result</td></tr></tbody></table><h3 id="_3-18-2透传力位混合控制补偿-位姿" tabindex="-1">3.18.2透传力位混合控制补偿(位姿) <a class="header-anchor" href="#_3-18-2透传力位混合控制补偿-位姿" aria-label="Permalink to &quot;3.18.2透传力位混合控制补偿(位姿)&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>透传力位混合控制补偿(位姿)</th></tr></thead><tbody><tr><td>参数说明</td><td>Force_Position_Move_Pose.msg  geometry_msgs/Pose Pose   #四元数信息 uint8 sensor     #所使用传感器类型，0-一维力，1-六维力 uint8 mode      #模式，0-沿工作坐标系，1-沿工具端坐标系 uint8 dir   #力控方向，0~5分别代表X/Y/Z/Rx/Ry/Rz，其中一维力类型时默认方向为Z方向 int16 force     #力的大小，精度0.1N或者0.1Nm</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/ForcePositionMovePose_Cmd rm_msgs/Force_Position_Move_Pose &quot;Pose:   position: {x: 0.0, y: 0.0, z: 0.0}   orientation: {x: 0.0, y: 0.0, z: 0.0, w: 0.0} sensor: 1 mode: 0 dir: 0 force: 0&quot;</td></tr><tr><td>返回值参数说明</td><td>成功：无返回，失败：报错信息查看rm_driver节点</td></tr><tr><td>返回值查看</td><td></td></tr></tbody></table><h3 id="_3-18-3透传力位混合控制补偿-弧度" tabindex="-1">3.18.3透传力位混合控制补偿(弧度) <a class="header-anchor" href="#_3-18-3透传力位混合控制补偿-弧度" aria-label="Permalink to &quot;3.18.3透传力位混合控制补偿(弧度)&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>透传力位混合控制补偿(弧度)</th></tr></thead><tbody><tr><td>参数说明</td><td>Force_Position_Move_Joint.msg  float32[] joint     #弧度信息 uint8 sensor      #所使用传感器类型，0-一维力，1-六维力 uint8 mode    #模式，0-沿工作坐标系，1-沿工具端坐标系 uint8 dir        #力控方向，0~5分别代表X/Y/Z/Rx/Ry/Rz，其中一维力类型时默认方向为Z方向 int16 force      #力的大小，精度0.1N或者0.1Nm uint8 dof       #机械臂自由度信息</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/ForcePositionMoveJiont_Cmd rm_msgs/Force_Position_Move_Joint &quot;joint: [0, 0, 0, 0, 0, 0] sensor: 0 mode: 0 dir: 0 force: 0 dof: 0&quot;</td></tr><tr><td>返回值参数说明</td><td>成功：无返回，失败：报错信息查看rm_driver节点</td></tr><tr><td>返回值查看</td><td></td></tr></tbody></table><h3 id="_3-18-4开启透传力位混合控制补偿模式" tabindex="-1">3.18.4开启透传力位混合控制补偿模式 <a class="header-anchor" href="#_3-18-4开启透传力位混合控制补偿模式" aria-label="Permalink to &quot;3.18.4开启透传力位混合控制补偿模式&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>开启透传力位混合控制补偿模式</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/StopForcePositionMove_Cmd std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/StopForcePositionMove_result</td></tr></tbody></table><h2 id="_3-19升降机构" tabindex="-1">3.19升降机构 <a class="header-anchor" href="#_3-19升降机构" aria-label="Permalink to &quot;3.19升降机构&quot;">​</a></h2><p>睿尔曼机械臂可集成自主研发升降机构。</p><h3 id="_3-19-1升降机构速度开环控制" tabindex="-1">3.19.1升降机构速度开环控制 <a class="header-anchor" href="#_3-19-1升降机构速度开环控制" aria-label="Permalink to &quot;3.19.1升降机构速度开环控制&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>升降机构速度开环控制</th></tr></thead><tbody><tr><td>参数说明</td><td>Lift_Speed.msg #升降机构速度开环控制 #Speed &lt; 0:升降机构向下运动 #Speed &gt; 0:升降机构向上运动 #Speed = 0:升降机构停止运动 int16 speed         #速度百分比，-100~100</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Lift_SetSpeed rm_msgs/Lift_Speed &quot;speed: 0&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Lift_Speed_Result</td></tr></tbody></table><h3 id="_3-19-2升降机构位置闭环控制" tabindex="-1">3.19.2升降机构位置闭环控制 <a class="header-anchor" href="#_3-19-2升降机构位置闭环控制" aria-label="Permalink to &quot;3.19.2升降机构位置闭环控制&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>升降机构位置闭环控制</th></tr></thead><tbody><tr><td>参数说明</td><td>Lift_Height.msg #升降机构运行到指定高度 uint16 height #目标高度，单位 mm，范围：0~2600 uint16 speed #速度百分比，1~100</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Lift_SetHeight rm_msgs/Lift_Height &quot;height: 0 speed: 0&quot;</td></tr><tr><td>返回值参数说明</td><td>std_msgs::Bool  成功返回：true；失败返回：false。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Plan_State</td></tr></tbody></table><h3 id="_3-19-3获取升降机构状态" tabindex="-1">3.19.3获取升降机构状态 <a class="header-anchor" href="#_3-19-3获取升降机构状态" aria-label="Permalink to &quot;3.19.3获取升降机构状态&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>获取升降机构状态</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/get_lift_state_cmd std_msgs/msg/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>LiftState.msg int16 height   #当前高度 int16 current  #当前电流 uint16 err_flag #驱动错误代码 byte mode  #当前升降状态，0-空闲，1-正方向速度运动，2-正方向位置运动，3-负方向速度运动，4-负方向位置运动</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/LiftState</td></tr></tbody></table><h2 id="_3-20机械臂状态主动上报" tabindex="-1">3.20机械臂状态主动上报 <a class="header-anchor" href="#_3-20机械臂状态主动上报" aria-label="Permalink to &quot;3.20机械臂状态主动上报&quot;">​</a></h2><h3 id="_3-20-1设置-udp-机械臂状态主动上报配置" tabindex="-1">3.20.1设置 UDP 机械臂状态主动上报配置 <a class="header-anchor" href="#_3-20-1设置-udp-机械臂状态主动上报配置" aria-label="Permalink to &quot;3.20.1设置 UDP 机械臂状态主动上报配置&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>设置UDP 机械臂状态主动上报配置</th></tr></thead><tbody><tr><td>参数说明</td><td>Set_Realtime_Push.msg  uint16 cycle：设置广播周期，为5ms的倍数（默认1即1*5=5ms,200Hz）。 uint16 port：设置广播的端口号（默认8089）。 uint16 force_coordinate：设置系统外受力数据的坐标系(仅带有力传感器的机械臂支持)。 string ip：设置自定义的上报目标IP 地址（默认192.168.1.10）。</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Set_Realtime_Push rm_msgs/Set_Realtime_Push &quot;cycle: 1 port: 8089 force_coordinate: 0 ip: &#39;192.168.1.10&#39;&quot;</td></tr><tr><td>返回值参数说明</td><td>成功返回：true；失败返回：false，driver终端返回错误码。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Set_Realtime_Push_Result</td></tr></tbody></table><h3 id="_3-20-2查询-udp-机械臂状态主动上报配置" tabindex="-1">3.20.2查询 UDP 机械臂状态主动上报配置 <a class="header-anchor" href="#_3-20-2查询-udp-机械臂状态主动上报配置" aria-label="Permalink to &quot;3.20.2查询 UDP 机械臂状态主动上报配置&quot;">​</a></h3><table tabindex="0"><thead><tr><th>功能描述</th><th>设置UDP 机械臂状态主动上报配置</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs/Empty</td></tr><tr><td>命令示例</td><td>rostopic pub /rm_driver/Get_Realtime_Push std_msgs/Empty &quot;{}&quot;</td></tr><tr><td>返回值参数说明</td><td>成功返回：true；失败返回：false，driver终端返回错误码。</td></tr><tr><td>返回值查看</td><td>rostopic echo /rm_driver/Get_Realtime_Push_Result</td></tr></tbody></table><h3 id="_3-20-3udp机械臂状态主动上报" tabindex="-1">3.20.3UDP机械臂状态主动上报 <a class="header-anchor" href="#_3-20-3udp机械臂状态主动上报" aria-label="Permalink to &quot;3.20.3UDP机械臂状态主动上报&quot;">​</a></h3><h4 id="六维力" tabindex="-1">六维力 <a class="header-anchor" href="#六维力" aria-label="Permalink to &quot;六维力&quot;">​</a></h4><table tabindex="0"><thead><tr><th>功能描述</th><th>六维力</th></tr></thead><tbody><tr><td>参数说明</td><td>Six_Force.msg float32 force_fx：沿x轴方向受力大小。 float32 force_fy：沿y轴方向受力大小。 float32 force_fz：沿z轴方向受力大小。 float32 force_mx：沿x轴方向转动受力大小。 float32 force_my：沿y轴方向转动受力大小。 float32 force_mz：沿z轴方向转动受力大小。</td></tr><tr><td>订阅命令</td><td>rostopic echo /rm_driver/UdpSixForce</td></tr></tbody></table><h4 id="一维力" tabindex="-1">一维力 <a class="header-anchor" href="#一维力" aria-label="Permalink to &quot;一维力&quot;">​</a></h4><table tabindex="0"><thead><tr><th>功能描述</th><th>一维力</th></tr></thead><tbody><tr><td>参数说明</td><td>Six_Force.msg float32 force_fx：沿x轴方向受力大小。 float32 force_fy：沿y轴方向受力大小。 float32 force_fz：沿z轴方向受力大小。（仅该数值有效） float32 force_mx：沿x轴方向转动受力大小。 float32 force_my：沿y轴方向转动受力大小。 float32 force_mz：沿z轴方向转动受力大小。</td></tr><tr><td>订阅命令</td><td>rostopic echo /rm_driver/UdpSixForce</td></tr></tbody></table><h4 id="机械臂错误" tabindex="-1">机械臂错误 <a class="header-anchor" href="#机械臂错误" aria-label="Permalink to &quot;机械臂错误&quot;">​</a></h4><table tabindex="0"><thead><tr><th>功能描述</th><th>机械臂错误</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::msg::UInt16 uint16 data：机械臂报错信息。</td></tr><tr><td>订阅命令</td><td>rostopic echo /rm_driver/ArmError</td></tr></tbody></table><h4 id="系统错误" tabindex="-1">系统错误 <a class="header-anchor" href="#系统错误" aria-label="Permalink to &quot;系统错误&quot;">​</a></h4><table tabindex="0"><thead><tr><th>功能描述</th><th>系统错误</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::msg::UInt16 uint16 data：系统报错信息。</td></tr><tr><td>订阅命令</td><td>rostopic echo/rm_driver/SysError</td></tr></tbody></table><h4 id="关节错误" tabindex="-1">关节错误 <a class="header-anchor" href="#关节错误" aria-label="Permalink to &quot;关节错误&quot;">​</a></h4><table tabindex="0"><thead><tr><th>功能描述</th><th>关节错误</th></tr></thead><tbody><tr><td>参数说明</td><td>Joint_Error_Code.msg uint16[] joint_error   #每个关节报错信息。</td></tr><tr><td>订阅命令</td><td>rostopic echo /rm_driver/JointErrorCode</td></tr></tbody></table><h4 id="机械臂弧度数据" tabindex="-1">机械臂弧度数据 <a class="header-anchor" href="#机械臂弧度数据" aria-label="Permalink to &quot;机械臂弧度数据&quot;">​</a></h4><table tabindex="0"><thead><tr><th>功能描述</th><th>机械臂弧度数据</th></tr></thead><tbody><tr><td>参数说明</td><td>sensor_msgs::msg::JointStatebuiltin_interfaces/Time stampint32 sec：时间信息，秒。uint32 nanosec：时间信息，纳秒。  string frame_id：坐标系名称。 string[] name：关节名称。 float64[] position：关节弧度信息。 float64[] velocity：关节速度信息。（暂未使用） float64[] effort：关节受力信息。（暂未使用）</td></tr><tr><td>订阅命令</td><td>rostopic echo /joint_states</td></tr></tbody></table><h4 id="位姿信息" tabindex="-1">位姿信息 <a class="header-anchor" href="#位姿信息" aria-label="Permalink to &quot;位姿信息&quot;">​</a></h4><table tabindex="0"><thead><tr><th>功能描述</th><th>位姿信息</th></tr></thead><tbody><tr><td>参数说明</td><td>geometry_msgs::msg::Pose Point position：机械臂当前坐标信息。   float64 x    float64 y    float64 z Quaternion orientation：机械臂当前姿态信息。    float64 x 0    float64 y 0   float64 z 0     float64 w 1</td></tr><tr><td>订阅命令</td><td>rostopic echo /rm_driver/Pose_State</td></tr></tbody></table><h4 id="当前六维力传感器系统外受力数据" tabindex="-1">当前六维力传感器系统外受力数据 <a class="header-anchor" href="#当前六维力传感器系统外受力数据" aria-label="Permalink to &quot;当前六维力传感器系统外受力数据&quot;">​</a></h4><table tabindex="0"><thead><tr><th>功能描述</th><th>当前六维力传感器系统外受力数据</th></tr></thead><tbody><tr><td>参数说明</td><td>Six_Force.msg float32 force_fx：当前传感器沿x轴方向受外力大小。 float32 force_fy：当前传感器沿y轴方向受外力大小。 float32 force_fz：当前传感器沿z轴方向受外力大小。 float32 force_mx：当前传感器沿x轴方向转动受外力大小。 float32 force_my：当前传感器沿y轴方向转动受外力大小。 float32 force_mz：当前传感器沿z轴方向转动受外力大小。</td></tr><tr><td>订阅命令</td><td>rostopic echo /rm_driver/UdpSixZeroForce</td></tr></tbody></table><h4 id="当前一维力传感器系统外受力数据" tabindex="-1">当前一维力传感器系统外受力数据 <a class="header-anchor" href="#当前一维力传感器系统外受力数据" aria-label="Permalink to &quot;当前一维力传感器系统外受力数据&quot;">​</a></h4><table tabindex="0"><thead><tr><th>功能描述</th><th>当前一维力传感器系统外受力数据</th></tr></thead><tbody><tr><td>参数说明</td><td>Six_Force.msg float32 force_fx：当前传感器沿x轴方向受外力大小。 float32 force_fy：当前传感器沿y轴方向受外力大小。 float32 force_fz：当前传感器沿z轴方向受外力大小。（仅该数据有效） float32 force_mx：当前传感器沿x轴方向转动受外力大小。 float32 force_my：当前传感器沿y轴方向转动受外力大小。 float32 force_mz：当前传感器沿z轴方向转动受外力大小。</td></tr><tr><td>订阅命令</td><td>rostopic echo /rm_driver/UdpSixZeroForce</td></tr></tbody></table><h4 id="系统外受力数据参考坐标系" tabindex="-1">系统外受力数据参考坐标系 <a class="header-anchor" href="#系统外受力数据参考坐标系" aria-label="Permalink to &quot;系统外受力数据参考坐标系&quot;">​</a></h4><table tabindex="0"><thead><tr><th>功能描述</th><th>系统外受力数据参考坐标系</th></tr></thead><tbody><tr><td>参数说明</td><td>std_msgs::UInt16 uint16 data：系统外受力数据的坐标系，0 为传感器坐标系 1 为当前工作坐标系 2 为当前工具坐标系。该数据会影响一维力和六维力传感器系统外受力数据的参考坐标系</td></tr><tr><td>订阅命令</td><td>rostopic echo /rm_driver/Udp_Coordinate</td></tr></tbody></table>',163),s=[o];function i(h,_,l,n,m,b){return r(),d("div",null,s)}const p=t(a,[["render",i]]);export{u as __pageData,p as default};
